import React, { Component } from 'react';
import '../../SCSS/login.scss'
import ngeLogo from '../Images/nge.png'


class login extends Component {
    render() {
        return (
            <div id="loginMainPanel">
                <div id="leftPanel">
                    <img src='../Images/nge.png' id="ngeLogo" />

                </div>

                <div id="middlePanel">

                </div>


            </div>
        );
    }
}

export default login;
